import React from 'react';
import { Link } from 'react-router-dom';
import Preloader from './Preloader';
import img1 from "../assets/img/logo-removebg.png";
import '../assets/css/welcomePage.css'; // Import CSS file for styling

const WelcomePage = () => {
    return (
        <div>
            <div className="background-animation">
                <div className="outer-circle">
                    <div className="wrapper">
                        <div className="breath">
                            <div className="flare1"></div>
                            <div className="flare2"></div>
                        </div>
                    </div>
                </div>
            </div>
            <Preloader />
            <div className="content-container">
                <h1 className="title">CARE CUBE</h1>
                <p className="subtitle">Connect-Embrace-Transform</p>
                <a href='#'><img src={img1} alt="CARE CUBE Logo" className=''/></a>
                <Link to="/lor" className="get-started-link">
                    <button className="get-started-button">Get Started</button>
                </Link>
            </div>
        </div>
    );
}

export default WelcomePage;
